import React from "react";
import Supervisor from "./Supervisor";
import Collaborators from "./Collaborators";

class HomeComponent extends React.Component {
    state = {
        drizzle: null
    };

    constructor(props) {
        super(props);
        console.log("PRops Drizle", this.props.route.drizzle);

        this.setState({
            drizzle: this.props.route.drizzle,
            drizzleState: this.props.render.drizzleState
        });
    }


    componentDidMount() {

    }

    render() {
        return (<div>
            <Supervisor
                drizzle={this.state.drizzle}
                drizzleState={this.state.drizzleState}
            />
            <Collaborators
                drizzle={this.state.drizzle}
                drizzleState={this.state.drizzleState}
            />
        </div>);
    }
}

export default HomeComponent;
